import React from 'react';
import { NavLink } from 'react-router-dom';
function Common({ heading, title, para, btns, btnc, imgsrc }) {
    return (
        <>
            <div className="container home">
                <div className="leftContent col-lg-6">
                    <h2>{heading}</h2>
                    <h4>{title}</h4>
                    <p>{para}</p>
                    {
                        btns &&
                        <NavLink to="/service"><button>{btns}</button></NavLink>
                    }
                    {
                        btnc &&
                        <NavLink to="/contact"><button>{btnc}</button></NavLink>
                    }
                </div>
                <div className="rightContent col-lg-6">
                    <img src={imgsrc} alt="homePageImage" />
                </div>
            </div>
        </>
    )
}

export default Common;
